css:
atom-text-editor,
:host {
  background-color: #ffffff;
  color: #111213;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #e0e0e0;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #e0e0e0;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #c5c8c6;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #ffffff;
  border-right: 1px solid #e0e0e0;
  color: #e0e0e0;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  padding: 0 0.25em 0 0.5em;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #e0e0e0;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #b4b7b4;
}
atom-text-editor .scroll-view,
:host .scroll-view {
  padding-left: 10px;
}
atom-text-editor .invisible,
:host .invisible {
  color: #111213;
}
atom-text-editor .cursor,
:host .cursor {
  color: #1d1f21;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #dfe1e0;
}
.comment {
  color: #c5c8c6;
}
.entity.name.type {
  color: #f0c674;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.keyword {
  color: #b294bb;
}
.keyword.control {
  color: #b294bb;
}
.keyword.operator {
  color: #111213;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #b294bb;
}
.constant {
  color: #de935f;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #de935f;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.variable {
  color: #cc6666;
}
.variable.interpolation {
  color: #a3685a;
}
.variable.parameter.function {
  color: #111213;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #ffffff;
}
.string {
  color: #b5bd68;
}
.string.regexp {
  color: #8abeb7;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #c5c8c6;
}
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #111213;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #a3685a;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #8abeb7;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #81a2be;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #cc6666;
}
.entity.other.attribute-name {
  color: #de935f;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #111213;
}
.meta.tag {
  color: #111213;
}
.none {
  color: #111213;
}
.markup.bold {
  color: #de935f;
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #cc6666;
}
.source.gfm .markup.link {
  color: #81a2be;
}
.source.gfm .link .entity {
  color: #8abeb7;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
